<template>
  <div class="w-full h-screen bg-red-500">
    <l-map ref="map" @click="addMarker" :min-zoom="minZoom" :crs="crs">
      <l-draw-toolbar position="topright" />
      <l-image-overlay :url="url" :bounds="bounds" />
      <l-marker draggable v-for="star in stars" :key="star.name" :lat-lng="star">
        <l-icon :icon-anchor="staticAnchor" class-name="someExtraClass">
          <div class="p-3 rounded-full bg-red-500 border-[1px] border-white"></div>
          <!-- <img
            class="h-8"
            src="data:image/jpeg;base64,"
          /> -->
        </l-icon>
        <l-popup :content="star.name" />
      </l-marker>
      <l-polyline :lat-lngs="travel" />
    </l-map>
  </div>
</template>

<script>
import { CRS } from 'leaflet'
import { LMap, LImageOverlay, LMarker, LPopup, LPolyline, LIcon } from 'vue2-leaflet'

export default {
  components: {
    LMap,
    LImageOverlay,
    LMarker,
    LPopup,
    LPolyline,
    LIcon,
  },
  data() {
    return {
      url: 'http://leafletjs.com/examples/crs-simple/uqm_map_full.png',
      bounds: [
        [-26.5, -25],
        [1021.5, 1023],
      ],
      minZoom: -2,
      crs: CRS.Simple,
      customText: 'You can add custom text to the map!',
      staticAnchor: [0, 0],
      stars: [
        { name: 'Sol', lng: 175.2, lat: 145.0 },
        { name: 'Mizar', lng: 41.6, lat: 130.1 },
        { name: 'Krueger-Z', lng: 13.4, lat: 56.5 },
        { name: 'Deneb', lng: 218.7, lat: 8.3 },
      ],
      travel: [
        [145.0, 175.2],
        [8.3, 218.7],
      ],
    }
  },
  mounted() {
    this.$refs.map.mapObject.setView([70, 120], 1)
  },
  methods: {
    addMarker(e) {
      this.stars.push({ name: 'New Star', lng: e.latlng.lng - 5, lat: e.latlng.lat })
    },
    // drawC
  },
}
</script>
